import React from 'react'
import { Route} from "react-router-dom";
import Home from '../components/Home'

const Routes = () =>  {
  return(
<> 
<Routes>
        <Route path="/" element={<Home />} />
     
</Routes>
       
</>
  ); 
}


export default Routes
